{% block title %}Category Home Page{% endblock %}

{% block body %}
    <!-- BEGIN: Subheader -->
    <div class=\"m-subheader \">
        <div class=\"d-flex align-items-center\">
            <div class=\"mr-auto\">
                <h3 class=\"m-subheader__title m-subheader__title--separator\">Category</h3>
                <ul class=\"m-subheader__breadcrumbs m-nav m-nav--inline\">
                    <li class=\"m-nav__item m-nav__item--home\">
                        <a href=\"#\" class=\"m-nav__link m-nav__link--icon\">
                            <i class=\"m-nav__link-icon la la-home\"></i>
                        </a>
                    </li>
                    <li class=\"m-nav__separator\">-</li>
                    <li class=\"m-nav__item\">
                        <a href=\"\" class=\"m-nav__link\">
                            <span class=\"m-nav__link-text\">Home</span>
                        </a>
                    </li>
                    <li class=\"m-nav__separator\">-</li>
                    <li class=\"m-nav__item\">
                        <a href=\"\" class=\"m-nav__link\">
                            <span class=\"m-nav__link-text\">Category</span>
                        </a>
                    </li>
                </ul>
            </div>
        </div>
    </div>
    <!-- END: Subheader -->
    <div class=\"m-content\">

        <!--begin::Portlet-->
        <div class=\"m-portlet\">
            <div class=\"m-portlet__head\">
                <div class=\"m-portlet__head-caption\">
                    <div class=\"m-portlet__head-title\">
                        <h3 class=\"m-portlet__head-text\">
                            Category List Table
                        </h3>
                    </div>
                </div>
            </div>
            <div class=\"m-portlet__body\">
                <a href=\"{{ path('category_new') }}\" class=\"btn btn-success\">Create New Category</a>

                <table class=\"table table-striped- table-bordered table-hover table-checkable\" id=\"m_table_1\">
                    <thead>
                    <tr>
                        <th>Id</th>
                        <th>Parent</th>
                        <th>Title</th>
                        <th>Keywords</th>
                        <th>Description</th>
                        <th>Image</th>
                        <th>Active</th>
                        <th>actions</th>
                    </tr>
                    </thead>
                    <tbody>
                    {% for category in categories %}
                        <tr>
                            <td>{{ category.id }}</td>
                            <td>{{ category.parent ? category.parent.title:'' }}</td>
                            <td>{{ category.title }}</td>
                            <td>{{ category.keywords }}</td>
                            <td>{{ category.description }}</td>
                            <td>{{ category.image }}</td>
                            <td>{{ category.isActive ? 'Oui': 'Non' }}</td>
                            <td>
                                <a href=\"{{ path('category_show', {'id': category.id}) }}\" class=\"btn btn-info\">Show</a>
                            </td>
                            <td>
                                <a href=\"{{ path('category_edit', {'id': category.id}) }}\" class=\"btn btn-info\">Edit</a>
                            </td>
                            <td>
                                {{ include('admin/category/_delete_form.html.twig') }}
                            </td>
                            </td>
                        </tr>
                    {% else %}
                        <tr>
                            <td colspan=\"10\">no records found</td>
                        </tr>
                    {% endfor %}
                    </tbody>
                </table>
            </div>
        </div>
    </div>
{% endblock %}
